import React from 'react';
import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Typography,
  Box,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import DownloadIcon from '@mui/icons-material/Download';
import MovieIcon from '@mui/icons-material/Movie';
import AudiotrackIcon from '@mui/icons-material/Audiotrack';
import HighQualityIcon from '@mui/icons-material/HighQuality';
import { formatFileSize } from '../utils/format';
import GetAppIcon from '@mui/icons-material/GetApp';

const GlassTableContainer = styled(TableContainer)({
  background: 'rgba(26, 26, 46, 0.6)',
  backdropFilter: 'blur(10px)',
  borderRadius: '15px',
  border: '1px solid rgba(255, 255, 255, 0.1)',
  boxShadow: '0 8px 32px 0 rgba(0, 0, 0, 0.37)',
  overflow: 'hidden',
});

const StyledTable = styled(Table)({
  '& .MuiTableCell-root': {
    borderColor: 'rgba(255, 255, 255, 0.1)',
    color: 'white',
  },
  '& .MuiTableHead-root .MuiTableCell-root': {
    background: 'rgba(255, 255, 255, 0.05)',
    fontWeight: 'bold',
  },
  '& .MuiTableRow-root:hover': {
    background: 'rgba(255, 255, 255, 0.05)',
  },
});

const DownloadButton = styled(Button)({
  background: 'linear-gradient(45deg, #673ab7 30%, #3f51b5 90%)',
  color: 'white',
  padding: '0.5rem 1.5rem',
  borderRadius: '25px',
  textTransform: 'none',
  fontSize: '1rem',
  fontWeight: 'bold',
  boxShadow: '0 3px 15px rgba(103, 58, 183, 0.2)',
  transition: 'all 0.3s ease',
  border: '2px solid transparent',
  '&:hover': {
    background: 'linear-gradient(45deg, #3f51b5 30%, #673ab7 90%)',
    transform: 'translateY(-2px)',
    boxShadow: '0 5px 20px rgba(103, 58, 183, 0.4)',
    border: '2px solid rgba(255, 255, 255, 0.2)',
  },
  '&:active': {
    transform: 'translateY(0)',
  },
  '& .MuiSvgIcon-root': {
    marginRight: '0.5rem',
  },
});

const QualityChip = styled(Box)({
  display: 'inline-flex',
  alignItems: 'center',
  gap: '0.5rem',
  padding: '4px 12px',
  borderRadius: '15px',
  background: 'rgba(255, 255, 255, 0.1)',
  color: 'white',
  fontSize: '0.875rem',
});

const OptionsContainer = styled(Box)({
  marginTop: '2rem',
  background: 'rgba(255, 255, 255, 0.05)',
  borderRadius: '15px',
  padding: '2rem',
  backdropFilter: 'blur(10px)',
  border: '1px solid rgba(255, 255, 255, 0.1)',
  boxShadow: '0 8px 32px 0 rgba(0, 0, 0, 0.37)',
});

const OptionsHeader = styled(Typography)({
  fontSize: '1.5rem',
  fontWeight: 'bold',
  marginBottom: '1.5rem',
  textAlign: 'center',
  color: '#fff',
  textShadow: '0 2px 4px rgba(0,0,0,0.3)',
});

const OptionsGrid = styled(Box)({
  display: 'grid',
  gridTemplateColumns: 'repeat(auto-fill, minmax(250px, 1fr))',
  gap: '1.5rem',
  '@media (max-width: 600px)': {
    gridTemplateColumns: '1fr',
  },
});

const OptionCard = styled(Box)({
  background: 'rgba(255, 255, 255, 0.05)',
  borderRadius: '12px',
  padding: '1.5rem',
  display: 'grid',
  gridTemplateColumns: 'auto 1fr auto',
  alignItems: 'center',
  gap: '1rem',
  border: '1px solid rgba(255, 255, 255, 0.1)',
  transition: 'all 0.3s ease',
  '&:hover': {
    transform: 'translateY(-5px)',
    background: 'rgba(255, 255, 255, 0.08)',
    boxShadow: '0 5px 15px rgba(0, 0, 0, 0.2)',
  },
});

const QualityInfo = styled(Box)({
  textAlign: 'center',
});

const QualityText = styled(Typography)({
  fontSize: '1.2rem',
  fontWeight: 'bold',
  color: '#fff',
  marginBottom: '0.3rem',
});

const FileInfo = styled(Typography)({
  color: 'rgba(255, 255, 255, 0.7)',
  fontSize: '0.9rem',
});

const DownloadOptions = ({ formats, onDownload }) => {
  if (!formats || formats.length === 0) return null;

  const filteredFormats = formats.filter(
    format => format.hasVideo && format.quality
  );

  const getFormattedSize = (bytes) => {
    if (!bytes) return 'غير معروف';
    const sizes = ['B', 'KB', 'MB', 'GB'];
    const i = Math.floor(Math.log(bytes) / Math.log(1024));
    return `${(bytes / Math.pow(1024, i)).toFixed(2)} ${sizes[i]}`;
  };

  return (
    <OptionsContainer>
      <OptionsHeader>اختر جودة التحميل المناسبة</OptionsHeader>
      <OptionsGrid>
        {filteredFormats.map((format) => (
          <OptionCard key={format.itag}>
            {format.hasAudio && !format.hasVideo ? (
              <AudiotrackIcon sx={{ fontSize: 30, color: '#673ab7' }} />
            ) : (
              <Box sx={{ 
                width: 30, 
                height: 30, 
                display: 'flex', 
                alignItems: 'center', 
                justifyContent: 'center',
                color: '#673ab7',
                fontWeight: 'bold' 
              }}>
                {format.qualityLabel || 'Audio'}
              </Box>
            )}
            <QualityInfo>
              <QualityText>
                {format.hasVideo ? format.qualityLabel : 'Audio Only'}
              </QualityText>
              <FileInfo>
                {format.container} • {getFormattedSize(format.contentLength)}
              </FileInfo>
            </QualityInfo>
            <DownloadButton
              variant="contained"
              onClick={() => onDownload(format.itag)}
              startIcon={<GetAppIcon />}
            >
              تحميل
            </DownloadButton>
          </OptionCard>
        ))}
      </OptionsGrid>
    </OptionsContainer>
  );
};

export default DownloadOptions;
